import styled from 'styled-components';

export const MainContainer = styled.div `
    display: flex;
    padding-left: 30px;
    flex-direction: column;
    height: 80vh;
    width: 30vw;
    background: rgba(255,255,255,0.15);
    box-shadow:  0 8px 32px rgba(32,38,135,0.37);
    backdrop-filter: blur(8.5px);
`;
